// Address definitions
#define KEY_BASE 0xFF200050
void display_text_on_vga(int x,int y, const char *text);
void write_pixel(int x, int y, short color);
void draw_colored_lines() {
   for (int x = 0; x < SCREEN_WIDTH; x++) {
        write_pixel(x, 3, YELLOW);
    }
    
    // Bottom border
    for (int x = 0; x < SCREEN_WIDTH; x++) {
        write_pixel(x, SCREEN_HEIGHT - 3, YELLOW);
    }
    
    // Left border
    for (int y = 0; y < SCREEN_HEIGHT; y++) {
        write_pixel(3, y, YELLOW);
    }
    
    // Right border
    for (int y = 0; y < SCREEN_HEIGHT; y++) {
        write_pixel(SCREEN_WIDTH - 3, y, YELLOW);
    }
}

// Function to write a pixel to the VGA screen buffer
void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char * character_buffer = (char *) (0x09000000 + (y<<7) + x);
  *character_buffer = c;
}
void write_pixel(int x, int y, short color) {
    volatile short *vga_addr = (volatile short *)(0x08000000 + (y << 10) + (x << 1));
    *vga_addr = color;
}
//to display string on vga
void display_text_on_vga(int x, int y, const char *text) {
    // Display each character of the string starting at the given (x, y) position
    while (*text) {
        write_char(x, y, *text);
        x++;
        text++;
    }
}
// Function to clear the VGA screen
void clear_screen() {
    for (int x = 0; x < SCREEN_WIDTH; x++) {
        for (int y = 0; y < SCREEN_HEIGHT; y++) {
            write_pixel(x, y, BLACK);
        }
    }
}
// Function to clear the VGA character buffer
void clear_char_buffer() {
     for (int x = 0; x < 80; x++)
    {
        for (int y = 0; y < 60; y++)
        {
            write_char(x, y, ' '); // Write space character to clear
        }
    }
}



void display_end_screen(){
	 clear_screen(); // Clear the VGA pixel buffer
    clear_char_buffer(); // Clear the VGA character buffer
	draw_colored_lines();
	 for (int x=0;x<320;x++)
   {
      // Draw a straight line in red across the screen centre
      write_pixel(x,100, 0xf800);
   }
	display_text_on_vga(32, 30, "GAME OVER !!!");
	
   for (int x=0;x<320;x++)
   {
      // Draw a straight line in red across the screen centre
      write_pixel(x, 160, 0xf800);
   }
	
}

