// Function to initialize the snake
void init_snake(int *snake_x, int *snake_y) {
    *snake_x = 0;
    *snake_y = 0;
}

// Function to draw the snake
void draw_snake(int snake_x[], int snake_y[], int snake_length) {
    for (int i = 0; i < snake_length; i++) {
        for (int x = snake_x[i]; x < snake_x[i] + SNAKE_SIZE; x++) {
            for (int y = snake_y[i]; y < snake_y[i] + SNAKE_SIZE; y++) {
                write_pixel(x, y, WHITE);
            }
        }
    }
}

// Function to generate food at a random position
void generate_food(int *food_x, int *food_y) {
    *food_x = rand() % (SCREEN_WIDTH - FOOD_SIZE);
    *food_y = rand() % (SCREEN_HEIGHT - FOOD_SIZE);
}

// Function to draw food
void draw_food(int food_x, int food_y) {
    for (int x = food_x; x < food_x + FOOD_SIZE; x++) {
        for (int y = food_y; y < food_y + FOOD_SIZE; y++) {
            write_pixel(x, y, FOOD_COLOR);
        }
    }
}

// Custom delay function
void delay(unsigned long ms) {
    clock_t start_time = clock();
    while (clock() < start_time + (ms * CLOCKS_PER_SEC / 100000));
}

// Main function
int main() {
    // Declare variables
	 clear_screen(); // Clear the VGA pixel buffer
    clear_char_buffer(); // Clear the VGA character buffer
	draw_colored_lines();
    int snake_x[SCREEN_WIDTH * SCREEN_HEIGHT / (SNAKE_SIZE * SNAKE_SIZE)];
    int snake_y[SCREEN_WIDTH * SCREEN_HEIGHT / (SNAKE_SIZE * SNAKE_SIZE)];
    int snake_length = 1;
    int food_x, food_y;
    volatile int *KEYS_ptr = (int *)KEY_BASE;
    int edge_capture;
    int direction = RIGHT; // Initial direction is to the right
    
    // Seed random number generator
    srand(time(NULL));
    
    // Initialize VGA screen
    clear_screen();
    
    // Display start screen
    display_start_screen();
    
    // Initialize snake
    init_snake(&snake_x[0], &snake_y[0]);
    
    // Generate initial food
    generate_food(&food_x, &food_y);
    
    // Draw initial snake and food
    draw_snake(snake_x, snake_y, snake_length);
    draw_food(food_x, food_y);
    
    while (1) {
		
        // Handle user input for snake direction
        edge_capture = *KEYS_ptr & 0xF; // Read the 4 least significant bits
        if (edge_capture) {
            if (edge_capture & 0x1) { // Key 0 pressed
                if (direction != RIGHT) { // Prevent reversal of direction
                    direction = LEFT;
                }
            } else if (edge_capture & 0x2) {
                if (direction != LEFT) {
                    direction = RIGHT;
                }
            } else if (edge_capture & 0x4) {
                if (direction != DOWN) {
                    direction = UP;
                }
            } else if (edge_capture & 0x8) {
                if (direction != UP) {
                    direction = DOWN;
                }
            }
            // Clear the edge capture register
            *(KEYS_ptr + 3) = edge_capture;
        }
        
        // Move the snake's body
        for (int i = snake_length; i > 0; i--) {
            snake_x[i] = snake_x[i - 1];
            snake_y[i] = snake_y[i - 1];
        }
        
        // Move the snake's head based on direction
        if (direction == LEFT) {
            snake_x[0] -= SNAKE_SIZE;
        } else if (direction == RIGHT) {
            snake_x[0] += SNAKE_SIZE;
        } else if (direction == UP) {
            snake_y[0] -= SNAKE_SIZE;
        } else if (direction == DOWN) {
            snake_y[0] += SNAKE_SIZE;
        }
        
        // Check for game over conditions (snake touching boundary)
        if (snake_x[0] < 0 || snake_x[0] >= SCREEN_WIDTH ||
            snake_y[0] < 0 || snake_y[0] >= SCREEN_HEIGHT) {
            //printf("Game Over! Final Score: %d\n", snake_length);
				clear_screen();
			display_end_screen();
            char buffer[32];
				snprintf(buffer, sizeof(buffer), "FINAL SCORE: %d", snake_length);
			display_text_on_vga(32 , 35, buffer);
            break; // End the game
        }
        
        // Check if snake eats food
        if (snake_x[0] < food_x + FOOD_SIZE && snake_x[0] + SNAKE_SIZE > food_x &&
            snake_y[0] < food_y + FOOD_SIZE && snake_y[0] + SNAKE_SIZE > food_y) {
            // Increase snake length
            snake_length++;
            // Generate new food
            generate_food(&food_x, &food_y);
        }
        
        // Draw snake and food
        draw_snake(snake_x, snake_y, snake_length);
        draw_food(food_x, food_y);
        
        // Clear the VGA screen for the next frame
        clear_screen();
	
        
        // Delay for smooth animation
        delay(SNAKE_SPEED);
    }
	
    
    return 0;
}